                <Link to={'/'}>
                    <span className='font-bold' style={{backgroundImage: "url('https://icooon-mono.com/i/icon_12620/icon_126200.svg')"}}>
                        SapporoVisor
                    </span>

                </Link>


            <Navigation />
        </header>
    )
}

export default Header;
